KEY = b64.b85decode("8i%9ZCx;T-zNj=DrZlo)ie!Xt3yXqx$HvL5_Yx|J")
IV = b64.b85decode("#-;o4fDHqVubpxg`Ra^7")
FILE_HASH = "1d25c79c2c3682c176ce373b26c299e2da64ea5f7a8cb51b14a2e352757a4774"
SCRIPT_NAME = "9Mai.py"
EXP_DATE = (datetime.now() + timedelta(days=7))  # Correction ici

def verify_integrity():
    """Vérification de l'intégrité du script"""
    current_hash = hashlib.sha256(DATA.encode()).hexdigest()
    if current_hash != FILE_HASH:
        print("[!] ALERTE: Fichier modifié")
        return False
    return True

def check_expiration():
    """Vérifie si le script a expiré"""
    if EXP_DATE is None:
        return True
    if datetime.now() > EXP_DATE:
        print(f"[!] EXPIRÉ depuis {EXP_DATE.strftime('%d/%m/%Y')}")  # Correction ici
        return False
    return True

def check_update():
    """Vérifie les mises à jour automatiquement"""
    print("\n[•] Recherche de mises à jour...")
    try:
        repo_url = f"https://raw.githubusercontent.com/DjahNoDead/IPToP/main/{SCRIPT_NAME}"
        response = requests.get(repo_url, timeout=15)
        
        if response.status_code == 200:
            new_hash = hashlib.sha256(response.text.encode()).hexdigest()
            
            if new_hash != FILE_HASH:
                print(f"[✓] Nouvelle version disponible ({len(response.text)/1024:.1f} Ko)")
                try:
                    with open(__file__, 'w', encoding='utf-8') as f:
                        f.write(response.text)
                    print("[✓] Mis à jour avec succès")
                    return True
                except Exception as e:
                    print(f"[!] Échec installation : {e}")
            else:
                print("[✓] Déjà à jour")
        else:
            print(f"[!] Erreur HTTP {response.status_code}")
    except Exception as e:
        print(f"[!] Échec connexion : {e}")
    return False

def run_script():
    """Exécute le script sécurisé"""
    try:
        encrypted = b64.b85decode(DATA.encode())
        cipher = AES.new(KEY, AES.MODE_CBC, IV)
        decrypted = unpad(cipher.decrypt(encrypted), AES.block_size)
        exec(zlib.decompress(decrypted).decode(), {'__name__': '__main__'})
    except Exception as e:
        print(f"[!] Erreur : {e}")

def main():
    """Point d'entrée principal"""
    if not verify_integrity() or not check_expiration():
        return
    
    if check_update():
        print("\n[•] Redémarrage automatique...")
        os.execv(__file__, [__file__] + sys.argv[1:])
        return
    
    run_script()

if __name__ == '__main__':
    main()
